import Link from 'next/link';
import { useEffect } from 'react';

const Home = () => {

    useEffect(() => {
        let item = fetch('https://source.unsplash.com/random')
            .then(data => {
                console.log(data);
                return data;
            });
        console.log(item);

    });

    return (
        <>
            <div>
                안녕하세요 오형남입니다!
            <Link href={{ pathname: 'user/profile', query: { name: '오형남' } }} as={'user/profile'}><a>프로필</a></Link>
            </div>
        </>
    );
}

Home.getInitialProps = async (context) => {
    return { name: context.query.name };
}

export default Home;
